  if (['signin','signup','forgotpass'].includes(props.type)){
    if (isEmpty(email)){
      errors.push({
        field: 'email',
        message: 'Please enter an email'
      });
    }
  }

  // Add error if password empty
  if (['signin', 'signup', 'changepass'].includes(props.type)){
    if (isEmpty(pass)){
      errors.push({
        field: 'pass',
        message: 'Please enter a password'
      });
    }
  }

  // Add error if confirmPass empty or
	// if it doesn't match pass.
	// Only for signup and changepass views.
  if (['signup', 'changepass'].includes(props.type)){
    if (isEmpty(confirmPass)){
      errors.push({
        field: 'confirmPass',
        message: 'Please confirm password'
      });
    }else if (pass !== confirmPass){
      errors.push({
        field: 'confirmPass',
        message: `This doesn't match your password`
      });
    }
  }

  const submitHandlersByType = {
    signin: ({ email, pass }) => {
      return auth.signin(email, pass)
        .then(user => {
        	props.onAuth(user);
      	});
    },
    signup: ({ email, pass }) => {
      return auth.signup(email, pass)
        .then(user => {
        	props.onAuth(user);
      	});
    },
    forgotpass: ({ email }) => {
      return auth.sendPasswordResetEmail(email)
      	.then(() => {
       		props.onStatus({
          	type: "success",
          	message: "Password reset email sent"
        	});
       });
    },
    changepass: ({ pass }) => {
      return auth.confirmPasswordReset(pass)
        .then(() => {
          props.onStatus({
